export default function Card({ name, max, min, img, onClose }) {
	// ac치 va tu c칩digo

	return (
		<div>
			<span>
				{name}
			</span>
			<div>
				<span>Minima</span>
				<spa>{min}</spa>
				<button onClick={onClose}> X </button>
			</div>
			<div>
				<span>Maxim</span>
				<spa>{max}</spa>
			</div>
			<img src={img} alt="" />
		</div>
	);
}
